const MessengerList = (props) => {

    const messengers = props.messengers;

    return (
        <div className="messenger-list">
            {messengers.map((m) => (
                <div className="messenger-preview" key={m.id}>
                    <h2>{ m.title }</h2>
                    <p>Creator: { m.creator }</p>
                </div>
            ))}
        </div>
    );
}
 
export default MessengerList;
